import CardsContainer from '../components/CardsContainer';
import Layout from '../components/Layout';
import useRedirectToLogin from '../hooks/useRedirectToLogin';

const ToDo = ({ toDoList = [] }) => {
  useRedirectToLogin();
  return (
    <Layout title="To Do Page">
      <CardsContainer title="To Do" toDoList={toDoList} />
    </Layout>
  );
};

export async function getStaticProps() {
  const response = await fetch('https://todo-nrestrepo05-api.herokuapp.com/api/v1/todo/', {
    headers: {
      Authorization: 'Token 784848d270aafe4fb18b0f00be90e8d0f41f5401',
    },
  });
  const toDoResponse = await response.json();
  const toDoList = toDoResponse.results;
  return {
    props: { toDoList },
  };
}

export default ToDo;
